querystring = {"transitScore": "", "regionId": "6_13410", "booleanFilters": "", "status": "", "greatSchoolsRating": "", "timeOnRedfin": "", "lotSize": "", "schoolTypes": "", "beds": "", "moveInDate": "", "stories": "", "bikeScore": "", "homeType": "", "yearBuilt": "", "prices": "", "baths": "", "walkScore": "", "squareFeet": ""}

headers = {
            "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
            "X-RapidAPI-Host": "redfin-com.p.rapidapi.com"
        }

response = requests.get(url, headers=headers, params=querystring)
print(response.json())

